// Given two lists operator, and operand. The first list has basic algebra operations, and
// the second list is a list of integers. Use the two given lists to build the algebric
// expression and return the evaluation of this expression.
//
// The basic algebra operations:
// Addition ( + )
// Subtraction ( - )
// Multiplication ( * )
// Floor division ( // )
// Exponentiation ( ** )
//
// Example:
// operator['+', '*', '-']
// array = [2, 3, 4, 5]
// result = 2 + 3 * 4 - 5
// => result = 9
//
// Note:
// The length of operator list is equal to the length of operand list minus one.
// Operand is a list of of non-negative integers.
// Operator list has at least one operator, and operand list has at least two operands.
func DoAlgebra(operator []string, operand []int) int {
	// First pass: handle exponentiation (**)
	for i := 0; i < len(operator); i++ {
		if operator[i] == "**" {
			result := int(math.Pow(float64(operand[i]), float64(operand[i+1])))
			operand = append(operand[:i], append([]int{result}, operand[i+2:]...)...)
			operator = append(operator[:i], operator[i+1:]...)
			i-- // Check the same position again in case of multiple exponentiations
		}
	}

	// Second pass: handle multiplication (*) and floor division (//)
	for i := 0; i < len(operator); i++ {
		if operator[i] == "*" {
			result := operand[i] * operand[i+1]
			operand = append(operand[:i], append([]int{result}, operand[i+2:]...)...)
			operator = append(operator[:i], operator[i+1:]...)
			i--
		} else if operator[i] == "//" {
			result := operand[i] / operand[i+1]
			operand = append(operand[:i], append([]int{result}, operand[i+2:]...)...)
			operator = append(operator[:i], operator[i+1:]...)
			i--
		}
	}

	// Third pass: handle addition (+) and subtraction (-)
	for i := 0; i < len(operator); i++ {
		if operator[i] == "+" {
			result := operand[i] + operand[i+1]
			operand = append(operand[:i], append([]int{result}, operand[i+2:]...)...)
			operator = append(operator[:i], operator[i+1:]...)
			i--
		} else if operator[i] == "-" {
			result := operand[i] - operand[i+1]
			operand = append(operand[:i], append([]int{result}, operand[i+2:]...)...)
			operator = append(operator[:i], operator[i+1:]...)
			i--
		}
	}

	return operand[0]
}

